// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "./Token.sol";
import "./Team.sol";

contract Ballot is Team {
  struct poll {
    uint number;
    string title;
    uint token;
  }
  uint pollNum;
  mapping(uint => poll) Polls;
  uint tokenSum;

  function setPoll(string memory _title) public {
    // 투표 설정하기(몇번째투표인지, 투표이름, 그 투표에 걸린 토큰)
    Polls[pollNum + 1] = poll(pollNum + 1, _title, 0);
    pollNum += 1;
  }

  function setToken(uint _num, uint _tpe) public {
    // 몇번째 투표에 토큰 몇개 걸지 설정
    Polls[_num].token = _tpe;
    tokenSum = tokenSum - _tpe;
  }

  function getPoll(uint _num) public view returns (uint, string memory, uint) {
    return (Polls[_num].number, Polls[_num].title, Polls[_num].token);
  }

  address leader;

  constructor(
    string memory _subject,
    uint _token,
    string memory _name
  ) public Team(_subject, _token, _name) {
    MT = new MyToken(_token);
    tokenSum = MT.getTotalSupply();
    leader = msg.sender;
  }

  function getTotal() public view returns (uint) {
    // 토큰 총 공급량
    return MT.getTotalSupply();
  }

  function getUserToken() public view returns (uint) {
    // 인당 토큰 몇 개 받을지
    return Team.Users[msg.sender].token;
  }

  function setTeam(string memory _teamName) public {
    // 팀 설정(수업명, 팀번호, 팀이름, 팀멤버주소, 투표개수, 총공급량)
    Teams[teamNum + 1] = team(
      subject,
      teamNum + 1,
      _teamName,
      teamMember,
      pollNum,
      MT.getTotalSupply()
    );
    teamNum += 1;
  }

  mapping(address => uint) voting;

  function vote(uint _token, address _addr) public returns (uint) {
    voting[_addr] += _token;
    Team.Users[msg.sender].token -= _token;
    return Team.Users[msg.sender].token;
  }

  function getVote(address _addr) public view returns (uint) {
    return voting[_addr];
  }

  // address ranker = leader;

  function ranking()
    public
    returns (address, address, address, address, address)
  {
    for (uint i; i < Team.teamMember.length - 1; i++) {
      for (uint j = 1; j < Team.teamMember.length; j++) {
        if (voting[Team.teamMember[i]] < voting[Team.teamMember[j]]) {
          (Team.teamMember[i], Team.teamMember[j]) = (
            Team.teamMember[j],
            Team.teamMember[i]
          );
        }
      }
    }

    return (
      Team.teamMember[0],
      Team.teamMember[1],
      Team.teamMember[2],
      Team.teamMember[3],
      Team.teamMember[4]
    );

    // Team.teamMember[i]
  }

  function what()
    public
    view
    returns (address, address, address, address, address)
  {
    return (
      Team.teamMember[0],
      Team.teamMember[1],
      Team.teamMember[2],
      Team.teamMember[3],
      Team.teamMember[4]
    );
  }
}

contracts/Register.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract signUp {
  struct user {
    bytes32 pw; //비번
    string name; //가입자 이름
    uint snum; // 학번
    bool registered; // default : false
  }

  mapping(string => user) accounts; //id와 구조체 user를 연결

  // 암호화 코드, private 부여
  function encrypt(string memory pw) private pure returns (bytes32) {
    return keccak256(bytes(pw));
  }

  // 회원 가입 코드
  function register(
    string memory id,
    string memory pw,
    string memory name,
    uint snum
  ) public {
    // accounts[id].registered == false
    require(!accounts[id].registered, "id is already registered");

    accounts[id] = user(encrypt(pw), name, snum, true);
  }

  // 2번의 검증, 먼저 id가 등록되었는가, 그 다음에 id-pw가 일치하는가
  function verifyAccount(string memory id, string memory pw) private view {
    require(accounts[id].registered, "no registered");
    require(accounts[id].pw == encrypt(pw), "password incorrect");
  }

  // login하는 기능
  function login(
    string memory id,
    string memory pw
  ) public view returns (string memory, uint) {
    // 위의 verifyAccount
    verifyAccount(id, pw);
    return (accounts[id].name, accounts[id].snum);
  }

  // 멤버를 삭제하는 기능  onlyonwer??????
  function withdraw(string memory id, string memory pw) public {
    // 위의 verifyAccount
    verifyAccount(id, pw);
    delete accounts[id];
  }
}

